import * as React from "react";
import Typography from "@mui/material/Typography";
import { makeStyles, createStyles } from "@mui/styles";
import {
  Button,
  Card,
  CardActions,
  CardContent,
  CardMedia,
} from "@mui/material";

const useStyles = makeStyles({
  title: {
    fontSize: 12,
    color: "red",
  },
});

// every card has:
// image, like button, title, explanation, date

// make another component that takes a start and end date and returns the images in that set (inclusive)

export default function PhotoCard() {
  const classes = useStyles();

  return (
    <Card sx={{ maxWidth: 600 }}>
      <CardMedia
        component="img"
        height="140"
        image="https://apod.nasa.gov/apod/image/2201/LeonardTail_Hattenbach_960.jpg"
        alt="green iguana"
      />
      <CardContent>
        <Typography
          className={classes.title}
          gutterBottom
          variant="h5"
          component="div"
        >
          Lizard
        </Typography>
        <Typography variant="body2" color="text.secondary">
          Lizards are a widespread group of squamate reptiles, with over 6,000
          species, ranging across all continents except Antarctica
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Share</Button>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}
